import React from "react";

import { Bar } from 'react-chartjs-2';

export default function LineChart(){

    const data2 = {
        labels: dateAxis,
        datasets: [
          {
            type: 'line',
            label: 'Percentage',
            // yAxisID: 'A', 
            borderColor: 'rgb(54, 162, 235)',
            borderWidth: 2,
            // fill: false,
            data: fourthCat,
          },
          {
            label: "C1",
            yAxisID: 'B',
            backgroundColor: "red",
            data: firstCat,
            stack: 2
          },
          {
            label: "C2",
            yAxisID: 'B',
            backgroundColor: "orange",
            data: secondCat,
            stack: 2
          },
          {
            label: "C3",
            yAxisID: 'B',
            backgroundColor: "green",
            data: thirdCat,
            stack: 2
          }
        ]
      }

     const options = {
      scales: {
        yAxes: [{
          id: 'A',
          type: 'linear',
          position: 'right',
        }, 
        {
          id: 'B',
          type: 'linear',
          position: 'left',
          ticks: {
            max: 1,
            min: 0
          }
        }]
      },
    }


    return <Bar data={data2} options={options} />    
}
